import React from "react";

import { Router, Route, RouteHandler } from "react-router";
import { Link } from "react-router-dom";
import logo from "../logo.png";
import "../App.css";
import "../routes/routes.js";
import { render } from "@testing-library/react";
import profile from "../logo2.png";
import Toolbar from "react-minimalist-toolbar";
import { ProgressBar, Button } from "react-bootstrap";
import { MDBBox } from "mdbreact";

function homepatient() {
  var menu = [
    {
      text: "Profil korisnika",
      items: [
        {
          text: "Izloguj se",
        },
      ],
    },
  ];

  const color1 = {
    backgroundColor: "yellow",
  };

  return (
    <div className="App">
      <div className="App-home">
        <Toolbar
          logo={logo}
          brand="InfoKC"
          menu={menu}
          className="toolbar"
        ></Toolbar>
        <div bgColor="transparent" className="App-boxes">
          <p>Dobrodosli</p>
          <MDBBox bgColor="transparent">primary color</MDBBox>
          <MDBBox bgColor="danger">danger color</MDBBox>
          <MDBBox bgColor="warning">warning color</MDBBox>
        </div>
      </div>
    </div>
  );
}
export default homepatient;
